// SpSideNavbar.js
import React from 'react';
import { NavLink } from 'react-router-dom';
import './SPSideNavbar.css';

const SpSideNavbar = () => {
  return (
    <div className="sp-side-navbar">
      <NavLink to="/spdashboard" className="navLinks" activeClassName="active-link">
        Upcoming Bookings
      </NavLink>
    </div>
  );
};

export default SpSideNavbar;
